import React from "react";
import LinkBtn from "../LinkBtn";
import "./style.css";

function Card(props) {
  return (
    <div
      className="card"
      style={{
        backgroundImage: props.image ? `url(${props.image})` : "none"
      }}
    >
        <h3>{props.name}</h3>

    </div>
  );
}

export default Card;
